import React, { useState } from 'react';
import { useNavigate } from "react-router-dom";
import Navbar from '../components/Navbar';
import APIInvoke from '../utils/APIInvoke';

const RegistroForm = () => {
    const navigate = useNavigate();
    const [userType, setUserType] = useState('cliente');

    const [seguidor, setSeguidor_] = useState({
        correo_electronicoS: "",
        contrasenaS: "",
        nombreS: "",
        documento_de_identidadS: "",
    });

    const { nombreS, correo_electronicoS, contrasenaS, documento_de_identidadS } = seguidor;

    const setSeguidor = (e) => {
        setSeguidor_({
            ...seguidor,
            [e.target.name]: e.target.value,
        });
    };

    const [club, setClub_] = useState({
        correo_electronicoC: "",
        contrasenaC: "",
        nombreC: "",
        estadioPropioC: "",
    });

    const { nombreC, correo_electronicoC, contrasenaC, estadioPropioC } = club;

    const setClub = (e) => {
        setClub_({
            ...club,
            [e.target.name]: e.target.value,
        });
    };

    const register = async () => {
        // Aquí va la lógica para el registro
    };

    const onSubmit = (e) => {
        e.preventDefault();
        register();
    };

    const ClubForm = () => (
        <>
            <div>
                <label>Nombre del Club:</label>
                <input
                    type="text"
                    name="nameUser"
                    value={nombreC}
                    onChange={setClub}
                    required
                />
            </div>
            {/* Otros campos específicos para Club */}
        </>
    );

    const SeguidorForm = () => (
        <>
            <div>
                <label>Nombre del Seguidor:</label>
                <input
                    type="text"
                    name="nombreS"
                    value={nombreS}
                    onChange={setSeguidor}
                    required
                />
            </div>
            <div>
                <label>Documento de identidad:</label>
                <input
                    type="text"
                    name="documento_de_identidadS"
                    value={documento_de_identidadS}
                    onChange={setSeguidor}
                    required
                />
            </div>
            <div>
                    <label>Correo electronico:</label>
                    <input
                        type="email"
                        name='correo_electronicoS'
                        value={correo_electronicoS}
                        onChange={setSeguidor}
                        required
                    />
                </div>
                <div>
                    <label>Contraseña:</label>
                    <input
                        type="password"
                        name='contrasenaS'
                        value={contrasenaS}
                        onChange={setSeguidor}
                        required
                    />
                </div>

        </>
    );

    return (
        <div>
            <Navbar />
            <form onSubmit={onSubmit} className="form">
                <h2>Registro</h2>
                <div>
                    <label>Tipo de Usuario:</label>
                    <select
                        value={userType}
                        onChange={(e) => setUserType(e.target.value)}
                    >
                        <option value="seguidor">Seguidor</option>
                        <option value="club">Club</option>
                    </select>
                </div>
                {userType === 'club' ? <ClubForm /> : <SeguidorForm />}
                <button type="submit">Registro</button>
            </form>
        </div>
    );
};

export default RegistroForm;
